import React from 'react';
import Joke from './Joke.js'
import jokesData from './jokesData.js'

function App() {

    const jokeComponents = jokesData.map(() => {
                return( 
                    <Joke question={jokesData.question} answer={jokesData.answer} />
                    )
            })
    return(
        <div>
            {jokeComponents}
        </div>
    )
}
export default App;
